import {Component, Fragment} from "react";
import AppLayout from '../components/app';
import {activePage} from "../actions/actions";
import iniModel from "../models/redux.state.ini";
import {connect} from 'react-redux'


class homePage extends Component {

    static getInitialProps({store, isServer, pathname, query}) {
        store.dispatch(activePage('home'));
        return {state: {...iniModel}};
    }

componentDidMount() {
    console.log(this.props)

}

    render() {
        return (
            <AppLayout>
                hello world i am home
            </AppLayout>
        )
    }
}


const stateToProps = state => {
    return {
        state: iniModel, ...state
    }
};


export default connect(stateToProps)(homePage);
